import React from 'react'
import Navbar from '../Component/Navbar';
import "./All.css"

 const Home = () => {
  return (
    <><br/>
    <Navbar/>
    <div className='sol'>
        <h1 style={{color:"white"}}>Geliştirici Portalı</h1>
        <p color='white'>Zuplo tarafından yönetilen API'ler, son kullanıcıların API belgelerini görüntüleyebildiği, API Anahtarlarını yönetebildiği ve kullanım analizlerini görüntüleyebildiği güzel bir geliştirici portalıyla dağıtılabilir.</p>
    </div>
    <div className='sag'>

    </div>

    </>
  )
}

export default Home;
